import React, { Component } from 'react'
import PeopleRoundedIcon from '@material-ui/icons/PeopleRounded';
import { withStyles,Card,Typography,Accordion,
    AccordionSummary ,AccordionDetails,Paper  } from '@material-ui/core';
export class CounterOfTeam extends Component {
    render() {
        return (
            <div>
                <Paper>
                <PeopleRoundedIcon style={{width:200,height:200,paddingTop:50}} ></PeopleRoundedIcon>
                </Paper>
            </div>
        )
    }
}

export default CounterOfTeam
